import React, { useState } from "react";

import {
  Nav,
  NavLink,
  Bars,
  NavMenu,
  NavBtn,
  NavBtnLink,
} from "./NavbarElements";

import Logo from "../../logo.png";

const Navbar = () => {
  const [toggle, setToggle] = React
  return (
    <>
      <Nav>
        <NavLink to="/">
          <img
            src={Logo}
            alt="Logo"
            style={{ width: "70px", height: "70px" }}
          />
        </NavLink>
        <Bars type="button" onClick={showMenu} />
        <NavMenu>
          <NavLink to="/about" activeStyle>
            About
          </NavLink>
          <NavLink to="/skills" activeStyle>
            Skills
          </NavLink>
          <NavLink to="/projects" activeStyle>
            Projects
          </NavLink>
          <NavLink to="/experience" activeStyle>
            Experience
          </NavLink>
        </NavMenu>
        <NavBtn>
          <NavBtnLink
            to="/about"
            type="button"
            onClick={(e) => {
              e.preventDefault();
              window.location.href =
                "https://drive.google.com/file/d/1S9P6iWBMSjreRBl_j6WqvnW1YeYZMUzb/view?usp=sharing";
            }}
          >
            Resume
          </NavBtnLink>
        </NavBtn>
      </Nav>
    </>
  );
};

export default Navbar;
